  input: 'TEXT,F3XA,,"This memo explains the several federal/non-federal allocable
    expenses reflected in Schedule E that has the ''-parent'' text in the description
    of the disbursement.  These entries are for expenses that were used to support
    50% non-federal and 50% federal.  However, the 50% federal consist of two federal
    candidates.  The FECfile software does not support entry for 50/50% with more
    than one federal candidate.  Hence, upon FEC Managers and Analyst recommendation,
    the following steps were followed to enter these unsual expenditures: 1) There
    is a parent entry is reported in line 21(a) where the entire amount is reported
    and the 50% federal piece is calculated via unique identifier.   This entry is
    then reflected in Schedule E since it is an independant expenditure, however,
    the candidate name field is left blank.  2)  The parent entry is split and reflected
    in Schedule E as two seperate memo entries.  These memo entries matches that of
    the parent entry except that the federal amount only reflects the amount that
    was allocated to each specificied federal candidate.  In a 50/50% scenario, this
    is usually allocated at 25% to one federal candidate, and 25% to the other.  Each
    parent entry is followed by its two relating federal candidate memo entry.  Percentage
    allocation varies depending on its unique identifier."'
